import React, { Component } from 'react';
import {withRouter} from 'react-router-dom';

import '../../style/common.scss'

class List extends Component {
    constructor(props) { 
        super(props); 
        this.state = {
        }
    }
    render() {
        console.log(this.props.result)
        let tickets = this.props.result
        // console.log(tickets) onClick={this.handlerGotoDetails.bind(this,tickets)}
        return (        
            <div className="resultList">
                {tickets.map(tickets=>{
                    return <div className="listM">
                        <ul>
                            <li >
                                <img src={tickets.thumbsrc} className="fl" />
                                <div className="info fl">
                                    <h4>{tickets.title}</h4>
                                    <p>{tickets.city}</p>
                                    <p>{tickets.price}</p>
                                    <span className="disc">售票中</span>
                                </div>
                            </li>
                        </ul>
                    </div>
                })}
            </div>
        );
    }
}

List = withRouter(List);
export default List;
